// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "./CarBlocks.sol";

/// @title The CarBlocksFactory Smart Contract
/// @author Quentin COLLETTE & Maxime LESBROS
/// @notice Smart Contract allowing to create & manage Carblocks NFT collections
/// @dev Stay away from this or you're facing sleep deprivation
contract CarBlocksFactory {
    address[] public carblocksCollection;
    event CarblocksCollectionCreated(
        address contractAddress,
        string name,
        string symbol,
        string energyType
    );

    function createCarblocksCollection(
        string calldata _name,
        string calldata _symbol,
        string calldata _energyType
    ) external returns (CarBlocks) {
        CarBlocks carblocks = new CarBlocks(_name, _symbol, _energyType);
        carblocksCollection.push(address(carblocks));

        emit CarblocksCollectionCreated(
            address(carblocks),
            _name,
            _symbol,
            _energyType
        );

        return carblocks;
    }
}

